import React from "react";
import TodoListItem from "./TodoListItem.js";
import TodoListData from "../data/todoListData.js";

function TodoList() {
  return (
    <ul>
      {TodoListData.map((item) => {
        return (
          <TodoListItem
            key={item.id}
            description={item.description}
          />
        )
      })}
    </ul>
  );
}
export default TodoList;
